import CityWeatherCard from "../CityWeatherCard/CityWeatherCard";
import ForeCastWeather from "../ForecastWeatherCard/ForecastWeatherCard";
import TodayWeather from "../TodayWeatherCard/TodayWeatherCard";
import './WeatherMainContainer.css'

function WeatherMainContainer() {

    const apiData = {
        temp: 32,
        temp_max: 35,
        temp_min:31,
        humidity: 2,
        wind: 1,
    }

    const cityData = [
        {
            min: 18,
            max:19,
            city: 'sydney',
        },
        {
            min: 18,
            max: 19,
            city: 'mel',
        },
        {
            min: 18,
            max: 20,
            city: 'bri'
        },
        {
            min: 18,
            max: 20,
            city: 'perth'
        }
    ];

    const foreCastData = [{
        min: 18,
        max:19,

    },
    {
        min: 18,
        max: 19,

    },
    {
        min: 18,
        max: 20,

    },
    {
        min: 18,
        max: 20,

    }]

  return (
    <div className="weather-main-container flex">
        <TodayWeather data={apiData}/>
        <div>
            <ForecastWeather foreCastData = {foreCastData}/>
            <CityWeatherCard cities={cityData}/>
        </div>
    </div>
  );
}

export default  WeatherMainContainer;
